import React ,{useState} from 'react'
import Link from 'next/link'
import axios from 'axios'

const FetchApi = () => {
    const [users, setUsers] = useState([])

    const getUsers = async()=>{
       const response = await (await axios.get("https://jsonplaceholder.typicode.com/users"))
    //    console.log(response)
       const data = response.data
       setUsers(data)

    }
  return (
    <>
      <button onClick={getUsers} style={{background:"green", marginTop:"10px", marginLeft:"10px", fontSize:"25px", padding:"2px 4px", }}>Get Data</button>
   
   
      <div style={{padding:"32px", margin:"10px 10px",background:"grey"}}>

<ul>
{users.map((user, id)=>{
    return <li key={id}>{user.username} <Link></Link></li>
})
}
</ul>

      </div>
    </>
  )
}

export default FetchApi
